import React from "react"

export default class MyList extends React.Component {
   constructor(props) {
       super(props)
   }
    render() {
        return(
            <ul>
                {this.props.items.map(item=> 
                    <li id={new Date}>{item.text}</li>)
                    }
            </ul>
        )
    }
}
